import React from 'react';
import './Main.css';
import { Link } from 'react-router-dom';

export default function Header() { // Corrected function name to start with a capital letter
    return (
        <div>
            <header style={{ padding: '10px 50px' }}>
                <h2 className="OnlineVoting" style={{ color: '#d2b200', fontFamily: 'Times New Roman', fontSize: '3em', marginBottom: '15px' }}>Online Voting</h2> {/* Changed class to className */}
                <nav className="navigation"> {/* Changed class to className */}
                    <Link to="/">Home</Link> {/* Corrected route path */}
                    <Link to="/motto">Motto</Link>
                    <Link to="/contact">Contact</Link>
                    <Link to="/about">About</Link>
                    <Link to="/login" className="btnlogin-popup" style={{ padding: '10px 15px', backgroundColor: '#d2b200', color: '#fff' }}>Login</Link> {/* Corrected route path */}
                    <Link to="/admin" className="btnlogin-popup" id="redirectButton" style={{ padding: '10px 15px', backgroundColor: '#d2b200', color: '#fff' }}>Admin</Link> {/* Corrected route path */}
                </nav>
            </header>
        </div>
    )
}
